    private static final int[] SUPPLY = new int[FLOW.length];
    private static final int[] DEMAND = new int[FLOW[0].length];

    //TODO add sanity checks for matrices (diagonal 0, rest non-zero) and arrays (non zero)
    static {
        if (Utils.checkSymmetric(FLOW)) throw new RuntimeException("TR FLOW is Symmetric!");

        //Calculates sum of each row of given matrix
        for (int i = 0; i < FLOW.length; i++) { // rows
            int sumRow = 0;
            for (int j = 0; j < FLOW[0].length; j++) { //columns
                sumRow = sumRow + FLOW[i][j];
            }
            SUPPLY[i] = sumRow;
        }

        //Calculates sum of each column of given matrix
        for (int i = 0; i < FLOW[0].length; i++) { //columns
            int sumCol = 0;
            for (int j = 0; j < FLOW.length; j++) { //rows
                sumCol = sumCol + FLOW[j][i];
            }
            DEMAND[i] = sumCol;
        }
    }

    static final int MAX_DEMAND = Arrays.stream(DEMAND).filter(i -> i > 0).max().orElseThrow();
    static final int MAX_SUPPLY = Arrays.stream(SUPPLY).filter(i -> i > 0).max().orElseThrow();

    static int flow(int from, int to) {
        return FLOW[from][to];
    }

    static int supply(int node) {
        return SUPPLY[node];
    }

    static int demand(int node) {
        return DEMAND[node];
    }
